import React, { Component } from 'react'
import 'bootstrap/dist/css/bootstrap.css'
// import {Route, Switch} from 'react-router-dom'
// import MyNavLink from '../../components/MyNavLink'
import IconFriend from '../../images/MyNav/联系人.png'
import IconGroup from '../../images/MyNav/群组.png'
import IconSelf from '../../images/MyNav/我的.png'
import IconExit from '../../images/MyNav/退出.png'

export default class MyNav extends Component {
  state = {
    navItemList: [
      {
        alt: '个人首页',
        title: '个人首页',
        iconPath: IconSelf,
      },
      {
        alt: '群组',
        title: '群组',
        iconPath: IconGroup,
      },
      {
        alt: '好友',
        title: '好友',
        iconPath: IconFriend,
      },
      {
        alt: '退出',
        title: '退出',
        iconPath: IconExit,
      }
    ]
  }

  render() {
    const {navItemList} = this.state;
    return (
      <div>
        {
          navItemList.map((item, index) => {
            return (
              <div key={index}>
                {index}
                <img className={['col-lg-1'].join(' ')} src={item.iconPath} title={item.title} alt={item.alt} />
              </div>
            )
          })
        }
      </div>
    )
  }
}
